import React from "react";
import {
  MDBBtn,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem
} from "mdbreact";
import "../styles/RouterPanel.css";

const SimulationOptions = props => {
  const IntruderWifi = () => {
    return (
      <MDBDropdown>
        <MDBDropdownToggle  caret color="deep-purple">
          Type
        </MDBDropdownToggle>
        <MDBDropdownMenu basic>
          <MDBDropdownItem>{'teste'}</MDBDropdownItem>
          <MDBDropdownItem>{'teste'}</MDBDropdownItem>
        </MDBDropdownMenu>
      </MDBDropdown>
    );
  };
  return (
    <div>
      <MDBBtn color="deep-purple" onClick={() => props.toogleShowRadius()}>
        Wifi Ranges
      </MDBBtn>
      <MDBBtn color="deep-purple" onClick={() => props.toogleIntruder()}>
        Intruder
      </MDBBtn>
      <IntruderWifi />
    </div>
  );
};

export default SimulationOptions;
